import React from 'react';

class TodoListCard extends React.Component {

    render() {
        const { todoList } = this.props;
        console.log("TodoListCard, todoList.id: " + todoList.id);
        return (
            <div className="card z-depth-0 todo-list-link">
                <div className="card-content grey-text text-darken-3">
                    <span className="card-title">{todoList.name}</span>
                </div>
                <div className="card-content grey-text text-darken-3">
                    <span className="card-title">{todoList.description}</span>
                </div>
                <div className="card-content grey-text text-darken-3">
                    <span className="card-title">{todoList.assigned_to}</span>
                </div>
                <div className="card-content grey-text text-darken-3">
                    <span className="card-title">{todoList.due_date}</span>
                </div>
                {/* <div className=''>
                    {this.props.listItem.completed === true && <span>Completed</span>}
                </div>
                <div className=''>
                    {this.props.listItem.completed === false && <span>Pending</span>}
                </div> */}
            </div>
        );
    }
}
export default TodoListCard;
